  `cost` text NOT NULL,
  `price` text NOT NULL,
  `total` text NOT NULL,
  `receipt_created_at` longtext NOT NULL,
  `created_at` longtext NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '2' COMMENT '1=accepted,2=not-accepted',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

